import React from "react";

function carRegisterform({onAddCar}){
return
<>
  <form onSubmit={handleSubmit}>
    <input type="text" placeholder="Car Name" id="name" name="name"/>
    <input type="text" placeholder="Car Model" id="model" name="model"/>
    <input type="submit" value="Add"/>
  </form>
</>
}

export default carRegisterform;
